import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Image } from 'react-bootstrap';
import NavigationBar from '../../components/NavigationBar'


import './styles.css';

function Quiz() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    setItems([
      {img: 0},
      {img: 0},
      {img: 0},
      {img: 0},]);
  },[]);

  return ( 
    <>
    <NavigationBar/>
    <Container > 
      {items.map((item) =>(
        <Row>
          <Col xs={12} md={12}>
            <Image src={item.img}/>
          </Col>
        </Row>
        ))}       
    </Container>   

    </>
  );
}

export default Quiz;
